  constructor(props) {
    super(props);

  }



  render() {
	  return (
	  <div >
	  <ul className='footbar'>
      <li>首页<i className='icon iconfont-sousuo'></i ></li>
      <li>发现</li>
      <li>订单</li>
      <li>我的</li>
    </ul>
	  </div>
	  )
  }
}
